import React from 'react';
import logo from './logo.svg';
import './App.css';
import { userInfo } from 'os';
class Contacts extends React.Component {
  render() {
    return (
      <div>Check Composition</div>
    )
  }
}
interface NameProps {
  value: string;
  onChange(event: any) : any;
  left: any
}

interface NameState {
}

class NameInput extends React.Component<NameProps, NameState> {
  constructor(props: any) {
    super(props);
  }
  render() {
    return (<div>
      <input type="text" value= {this.props.value} onChange={this.props.onChange}/>
      {this.props.left}
    </div>)
  }
}
interface AppProps {}
interface AppState {
  name: string
}
class App extends React.Component<AppProps, AppState> {
  constructor(props: any) {
    super(props);
    this.state = {
      name: ''
    }
    this.changeField = this.changeField.bind(this);
  }
  changeField(event: any) {
    this.setState({name: event.target.value})
  }
  render() {
    let name1: string = 'Aiymkoz';
    let surname: string = 'Bigaliyeva';
    let fullname: string = `${name1} ${surname}`;
    let arr: number[] = [1,2,3]
    return(
      <div>
        {fullname}{arr}
        <div>Name</div><NameInput value={this.state.name} onChange={this.changeField} left={<Contacts />}/>
        <div>Name2</div><NameInput value={this.state.name} onChange={this.changeField} left={<Contacts />}/>
      </div>
    )
  }
}


export default App;
